package jerry.korvideo.parser

import org.junit.Before
import org.junit.Test
import java.io.Reader
import kotlin.test.assertEquals
import kotlin.test.assertTrue

class ProgramViewerPageParserTest2 {
    private lateinit var sample2: String
    private lateinit var sample3: String

    @Before
    fun setUp() {
        sample2 = ClassLoader
            .getSystemClassLoader()
            .getResourceAsStream("program_viewer_page_sample_2.htm")
            .bufferedReader()
            .use(Reader::readText)
        sample3 = ClassLoader
            .getSystemClassLoader()
            .getResourceAsStream("program_viewer_page_sample_3.htm")
            .bufferedReader()
            .use(Reader::readText)
    }

    @Test
    fun parse_size_sample2() {
        val testInstance = ProgramViewerPageParser(sample2)

        val result = testInstance.parse()
        assertEquals(1, result.size)
    }

    @Test
    fun parse_videoSupplierName_sample2() {
        val testInstance = ProgramViewerPageParser(sample2)

        val data = testInstance.parse().first()
        assertEquals("YouTube-1", data.videoSupplierName)
    }

    @Test
    fun parse_propertyMap_sample2() {
        val testInstance = ProgramViewerPageParser(sample2)

        val data = testInstance.parse().first()
        val propertyMap = data.formData.propertyMap
        assertEquals(
            "ctl00\$ContentPlaceHolder1\$viewlink1\$GridView1\$ctl02\$linkBtnHost",
            propertyMap["__EVENTTARGET"]
        )
        assertEquals(
            "",
            propertyMap["__VIEWSTATE"]
        )
        assertEquals(
            "64262183",
            propertyMap["__VIEWSTATEGENERATOR"]
        )
        assertEquals(
            "Z9mDky-tC9dsR-2DoPwLvRVVRuW_82bL5g2azMDQPMAaWKunhY_TD253Yw7uoHZcArV4X8NL-U6jPyODmb8Wqjh2Khw1",
            propertyMap["__PREVIOUSPAGE"]
        )
        assertEquals(
            "/wEWCAKq1PrJCALL5+jQCAKHsZT4DgKP2JzPBwKx0+7eAwLGgfvJBAKwsc3dAwL+srzkAeEez1uOGk3WKL1/Ivfkj8PLhx1C",
            propertyMap["__EVENTVALIDATION"]
        )
        assertEquals(
            "무한도전 - 271:668",
            propertyMap["ctl00\$ContentPlaceHolder1\$viewlink1\$txtTitle"]
        )
        assertEquals(
            "http://joovideo.com/viewlink.aspx?Num=84389987055764124",
            propertyMap["ctl00\$ContentPlaceHolder1\$viewlink1\$txtUrl"]
        )
        assertTrue(propertyMap["__EVENTARGUMENT"].isNullOrEmpty())
    }

    @Test
    fun parse_size_sample3() {
        val testInstance = ProgramViewerPageParser(sample3)

        val result = testInstance.parse()
        assertEquals(17, result.size)
    }

    @Test
    fun parse_videoSupplierName_sample3() {
        val testInstance = ProgramViewerPageParser(sample3)

        val data = testInstance.parse().first()
        assertEquals("SMango-1", data.videoSupplierName)
    }

    @Test
    fun parse_propertyMap_sample3() {
        val testInstance = ProgramViewerPageParser(sample3)

        val data = testInstance.parse().first()
        val propertyMap = data.formData.propertyMap
        assertEquals(
            "ctl00\$ContentPlaceHolder1\$viewlink1\$GridView1\$ctl02\$linkBtnHost",
            propertyMap["__EVENTTARGET"]
        )
        assertEquals(
            "",
            propertyMap["__VIEWSTATE"]
        )
        assertEquals(
            "64262183",
            propertyMap["__VIEWSTATEGENERATOR"]
        )
        assertEquals(
            "Z9mDky-tC9dsR-2DoPwLvRVVRuW_82bL5g2azMDQPMAaWKunhY_TD253Yw7uoHZcArV4X8NL-U6jPyODmb8Wqjh2Khw1",
            propertyMap["__PREVIOUSPAGE"]
        )
        assertEquals(
            "/wEWFAL/wOKeCwLL5+jQCAKHsZT4DgKP2JzPBwKx0+7eAwKYi5jLBwLC2c/JAgKZkvXZBQK3+4QJAqKx4MkFAvCtl/oGAvuBrIIFApXPzoQMAtShyqoCAqbVr+8KAv3hzfINAv3hsfINAsaB+8kEArCxzd0DAv6yvOQB32vkrsFuC460G10AhKBdxH9gU18=",
            propertyMap["__EVENTVALIDATION"]
        )
        assertEquals(
            "전지적 참견 시점 - 7408:12",
            propertyMap["ctl00\$ContentPlaceHolder1\$viewlink1\$txtTitle"]
        )
        assertEquals(
            "http://joovideo.com/viewlink.aspx?Num=2093274078808899596",
            propertyMap["ctl00\$ContentPlaceHolder1\$viewlink1\$txtUrl"]
        )
        assertTrue(propertyMap["__EVENTARGUMENT"].isNullOrEmpty())
    }
}
